// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract TimeLock {
    IERC20 public token;
    uint256 public tokenRatePerSecond = 1e15; // 每秒 0.001 MTK（根據你需求可改）

    struct LockedMessage {
        bytes32 encryptedMessage;
        uint256 unlockTime;
        address owner;
    }

    mapping(uint256 => LockedMessage) public messages;
    uint256 public messageCount;

    constructor(address _tokenAddress) {
        token = IERC20(_tokenAddress);
    }

    function lockMessage(bytes32 _encryptedMessage, uint256 _lockDuration) external {
        uint256 cost = _lockDuration * tokenRatePerSecond;
        require(token.allowance(msg.sender, address(this)) >= cost, "Not enough token allowance");
        require(token.transferFrom(msg.sender, address(this), cost), "Token transfer failed");

        messages[messageCount] = LockedMessage({
            encryptedMessage: _encryptedMessage,
            unlockTime: block.timestamp + _lockDuration,
            owner: msg.sender
        });

        messageCount++;
    }

    function unlockMessage(uint256 _messageId) external view returns (bytes32) {
        LockedMessage storage message = messages[_messageId];
        require(block.timestamp >= message.unlockTime, "Message still locked");
        require(message.owner == msg.sender, "Not the owner");
        return message.encryptedMessage;
    }
}
